static char __pyx_k_122[] = "Return an array of zeros with the same shape and type as a given array.\n\n    Equivalent to ``a.copy().fill(0)``.\n\n    Parameters\n    ----------\n    a : array_like\n        The shape and data-type of `a` define the parameters of\n        the returned array.\n\n    Returns\n    -------\n    out : ndarray\n        Array of zeros with same shape and type as `a`.\n\n    See Also\n    --------\n    ones_like : Return an array of ones with shape and type of input.\n    empty_like : Return an empty array with shape and type of input.\n    zeros : Return a new array setting values to zero.\n    ones : Return a new array setting values to one.\n    empty : Return a new uninitialized array.\n\n    Examples\n    --------\n    >>> x = np.arange(6)\n    >>> x = x.reshape((2, 3))\n    >>> x\n    array([[0, 1, 2],\n           [3, 4, 5]])\n    >>> np.zeros_like(x)\n    array([[0, 0, 0],\n           [0, 0, 0]])\n\n    >>> y = np.arange(3, dtype=np.float)\n    >>> y\n    array([ 0.,  1.,  2.])\n    >>> np.zeros_like(y)\n    array([ 0.,  0.,  0.])\n\n    ";
