static char __pyx_k_132[] = "Return a 2-D array with ones on the diagonal and zeros elsewhere.\n\n    Parameters\n    ----------\n    N : int\n      Number of rows in the output.\n    M : int, optional\n      Number of columns in the output. If None, defaults to `N`.\n    k : int, optional\n      Index of the diagonal: 0 refers to the main diagonal, a positive value\n      refers to an upper diagonal, and a negative value to a lower diagonal.\n    dtype : dtype, optional\n      Data-type of the returned array.\n\n    Returns\n    -------\n    I : ndarray (N,M)\n      An array where all elements are equal to zero, except for the `k`-th\n      diagonal, whose values are equal to one.\n\n    See Also\n    --------\n    diag : Return a diagonal 2-D array using a 1-D array specified by the user.\n\n    Examples\n    --------\n    >>> np.eye(2, dtype=int)\n    array([[1, 0],\n           [0, 1]])\n    >>> np.eye(3, k=1)\n    array([[ 0.,  1.,  0.],\n           [ 0.,  0.,  1.],\n           [ 0.,  0.,  0.]])\n    \n    ";
